import React from "react";

function Image({ link, col }) {
  const height = {
    width: "100%"
  };
  return (
    <div className={col}>
      <img style={height} className="img-fluid" src={link} href="_blank" />
    </div>
  );
}
function ContactUs() {
  return (
    <div>
      <form>
        <input type="text" placeholder="text"></input>
      </form>
    </div>
  );
}
